import React, { useState, useEffect } from 'react';
import './sdk.css';
import axios from 'axios';
import ProjectComponent from './ProjectComponent/boxcomp';

const Sdk = (props) => {
    const { email } = props;
    const [projectList, setProjectList] = useState([]);

    const getProjects = async () => {
        const response = await axios.post('http://localhost:3001/get-projects', {
            email: email
        });
        setProjectList(response.data);
    }

    useEffect(() => {
        getProjects();
    }, [email]);

    return (
        <div className='sdk-container'>
            <h1 className='sdk-heading'>Account</h1>
            <br />
            <h2>
                Create a Project <span className="plus-icon">+</span>
            </h2>
            <div className="sdk-projects">
                {projectList.map(project => (
                    <ProjectComponent key={project.id} data={project} />
                ))}
            </div>
        </div>
    );
};

export default Sdk;
